import React, { Component } from 'react'
import Grid from '@material-ui/core/Grid'
import { makeStyles } from '@material-ui/styles'
import Typography from '@material-ui/core/Typography'
const useStyles = makeStyles(theme => ({
    root: {
        color:'black'
    },
    fono: {

    }
}))

export default class Inicio extends Component {
    render() {
        return (
            <Grid container xs={12} >
                <Grid item xs={12}>
                    <p>FONO EMERGENCIA 800 800 911 </p>
                </Grid>

                <Grid item xs={6}>
                    <Typography styles={{color:black}}variant="h2">
                        Servicios Destacados
                    </Typography>
                    <Typography variant="body2" color="textSecondary" component="p">
                        Somos un servicio de rescate médico que se conecta con usted al instante que nos llama, y lo acompaña durante todo el proceso de solución de la emergencia o imprevisto de salud.
                    </Typography>
                </Grid>

                <Grid item container xs={6}>
                    <Grid item xs={3}>

                    </Grid>

                    <Grid item xs={3}>

                    </Grid>
                </Grid>

            </Grid>
        )

    }
}
